//SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface IAuction {

    function initialize() external; 

    function setPrice(address,uint256,uint256) external; 

    function updateAuctionLength(uint256) external; 

    function start() external payable; 

    function bid() external payable; 

    function end() external; 


    function updateAuction(address) external;
    
    
    // ---------------    auction     ---------------------

    /// @notice An event emitted when a user updates their price
    event SetPrice(address nft,uint256 nftId,uint price);

    /// @notice An event emitted when an auction starts
    event Start(address indexed buyer, uint price, uint auctionEnd);

    /// @notice An event emitted when a bid is made
    event Bid(address indexed buyer, uint price, uint auctionEnd);

    /// @notice An event emitted when an auction is won
    event Won(address indexed buyer, uint price);
    
    /// @notice An event emitted when update auction length
    event UpdateAuctionLength(uint256 length);
  
}

//SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface IRouterData {
    // ---------------    address  ------------------------
    function factory() view external returns(address);

    function vault() view external returns(address); 
    
    function veToken() view external returns(address); 
    
    function auction() view external returns(address); 
    
    function vote() view external returns(address); 

    function division() view external returns(address); 
    
    function curator() view external returns(address); 
     
    // ---------------    manage    ----------------------
    function whiteList(address) view external returns(bool);

    function initializer() view external returns(bool);

    function open() view external returns(bool);

    // ---------------    router     ---------------------
    function daoName() view external returns(string memory);
    
    function lastClaimed() view external returns(uint256);

    function reserveRatio() view external returns(uint256);

    function reserveAmount() view external returns(uint256);

    function supply() view external returns(uint256);

    function fee() view external returns(uint256);
}

//SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface IRouter {
    function initialize(address,string memory) external;

    function curatorDeposit(address[] memory,uint256[] memory,uint256[] memory) external;

    function issue(uint256,string memory,uint256,uint256,uint256,uint256) external;

    function claimFees() external;

    function cash() external;

    // whiteList
    function mintToScale(uint256,address) external returns(uint256);

    function updateRouter(address) external;

    // get
    function versionInfo() pure external returns(string memory,uint16);

    function veTokenTemplate() view external returns(address); 

    function vaultTemplate() view external returns(address); 

    function auctionTemplate() view external returns(address); 

    function voteTemplate() view external returns(address); 

    function divisionTemplate() view external returns(address); 

    // event
    event Initialize(address curator, address vault); 

    event Cash(address indexed owner, uint256 shares); 

    event CuratorDeposit(address[] nft, uint256[] nftId,uint256[] amount); 

    event Issue(uint256 supply,string name, string symbol,uint256 reserveRatio, uint256 EntireVaultPrice,uint256 depositLength,uint256 rewardLength,address vetoken,address auction,address vote,address division); 
}

//SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface IAuctionData {

    // ---------------   Dao Address  ------------------------
    function router() external returns(address);

    // ---------------    manage    ----------------------
    function initializer() external returns(bool);

    // ---------------    auction     --------------------- 
    function auctionLength() external returns(uint256);  
}

